import React from "react";
import Dp from "../img/dp.jpeg";
import PLCard from "./PLCard";

const Profile = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-4">
      <div className=" shadow col-span-3 m-3 rounded-2xl bg-gray-300 h-screen p-2">
        <h1 className="text-gray-700 text-base m-2   box-border h-auto w-32 border-4 px-2 bg-yellow-300 rounded-xl">
          Basic Info:
        </h1>
      </div>
    </div>
  );
};

export default Profile;
